import React, { Component} from 'react';
//import { Button} from 'react-bootstrap';
import { Link } from 'react-router-dom';
//import axios from 'axios';

export default class Home extends Component {
  render() {
    return (
      <div>
        <h1>Home</h1>
        <h3 style = {{paddingTop: '1px'}}>Who are we?</h3>
        <h5>We are a supplement store that sell vitamins and nutrient capsules for people to take!</h5>
        <h5 style = {{paddingBottom: '25px'}}>Are you ready to check out our store? Press the button below to start!</h5>
        <Link to="/item" className="btn btn-primary" style={{paddingRight: '10px'}}>View List</Link>
        <Link to="/item/add" className="btn btn-primary"> Add Item</Link>
      </div>
    )
  }
}
